import "./LeftPane.css";

const Leftpane = (props) => {
    return (
        <nav className="dashboard__nav">
            <li className="dashboard__li">Home </li>
            <li className="dashboard__li">Facturen</li>
            <li className="dashboard__li"></li>
            <li className="dashboard__li">Bestellingenr</li>
            <li className="dashboard__li">Contact</li>
        </nav>
    );
}

export default Leftpane;
